l=1 %[output:85aac0be]

p=[l*(cos(q1)+cos(q1+q2)+cos(q1+q2+q3)); %[output:group:3d63dd98] %[output:41d70ed4]
    l*(sin(q1)+sin(q1+q2)+sin(q1+q2+q3))] %[output:group:3d63dd98] %[output:41d70ed4]
j=jacobian(p,[q1,q2,q3]) %[output:6d7188f5]
jp=pinv(j) %[output:9ba5eba3]
%vpasolve((y-2)^2+(0.25^2-0.5^2),y)
H=norm([cos(q1)+cos(q1+q2)-1;sin(q1)+sin(q1+q2)-1.567]) %[output:37108d7f]
DeH=vpa(subs(simplify([diff(H,q1);diff(H,q2);diff(H,q3)]),[q1,q2,q3],[0,pi/2,-pi/2])) %[output:91722489]
first_part=jp*[0;1] %[output:8ab2e036]
second_part=eye(3)-jp*j %[output:1288d041]
qdot=vpa(subs(first_part+second_part*-DeH,[q1,q2,q3],[0,pi/2,-pi/2])) %[output:1fb5ed49]
vm=subs(j(:,1:2)*qdot(1:2),[q1,q2,q3],[0,pi/2,-pi/2]) %[output:68688a13]
qdot1=vpa(subs(jp*[0;1],[q1,q2,q3],[0,pi/2,-pi/2])) %[output:9027b8d6]
P1=vpa(simplify(subs(-jp*j,[q1,q2,q3],[0,pi/2,-pi/2]))) %[output:3d0e4d4b]
p2=[l*(cos(q1)+cos(q1+q2)); %[output:group:631eda63] %[output:0cde8bcb]
    l*(sin(q1)+sin(q1+q2))] %[output:group:631eda63] %[output:0cde8bcb]
j2=subs(jacobian(p,[q1,q2,q3]),[q1,q2,q3],[0,pi/2,-pi/2]) %[output:34134f09]
qdot2=qdot1+pinv((j2*P1))*(vm-j2*qdot1) %[output:53a23cc3]




